{"translationLines":[{"lineNumber":202362,"originalJapaneseLine":"「というわけで頑張ってねー、あいやー」","translatedEnglishLine":"\"So, do your best—aye-ya!\""},{"lineNumber":202363,"originalJapaneseLine":"ハニーキングが持っていた杖で、","translatedEnglishLine":"With the staff that Honey King was holding,"},{"lineNumber":202364,"originalJapaneseLine":"雲をこっつんこと叩く。","translatedEnglishLine":"he tapped the clouds with a little bump."},{"lineNumber":202365,"originalJapaneseLine":"その瞬間――","translatedEnglishLine":"At that very moment—"},{"lineNumber":202366,"originalJapaneseLine":"体が地面を突き抜けて、あなたは空に投げ出された。","translatedEnglishLine":"your body pierced through the ground and you were thrown out into the sky."},{"lineNumber":202367,"originalJapaneseLine":"「ほんぎゃーーーー！？！？！？","translatedEnglishLine":"\"Whoaaaaaaa!?!?!"},{"lineNumber":202368,"originalJapaneseLine":"　なになになに、どうなってんのー！？」","translatedEnglishLine":"What what what, what's going on!?"},{"lineNumber":202369,"originalJapaneseLine":"「あ、くッ！？」","translatedEnglishLine":"\"Ah, ugh!?\""},{"lineNumber":202370,"originalJapaneseLine":"「……うぐっ！？」","translatedEnglishLine":"\"…Ugh!?\""},{"lineNumber":202371,"originalJapaneseLine":"「きゃあああああああああああ！？」","translatedEnglishLine":"\"Kyaaaaaaa!?!?\""},{"lineNumber":202372,"originalJapaneseLine":"「きゃああああ！？　お、落ちてる！？」","translatedEnglishLine":"\"Kyaa!? Are we falling!?\""},{"lineNumber":202373,"originalJapaneseLine":"「きゃああああああ！？」","translatedEnglishLine":"\"Kyaaaaaa!?\""},{"lineNumber":202374,"originalJapaneseLine":"「がっ！？　糞がァア！」","translatedEnglishLine":"\"Gah!? Damn it!\""},{"lineNumber":202375,"originalJapaneseLine":"「にゃにゃにゃ！？」","translatedEnglishLine":"\"Nya nya nya!?\""},{"lineNumber":202376,"originalJapaneseLine":"「なっ！？　落ちてるのか！？」","translatedEnglishLine":"\"What!? Are we really falling!?\""},{"lineNumber":202377,"originalJapaneseLine":"「わーーーー……落ちてる……」","translatedEnglishLine":"\"Waaaaa... We're falling...\""},{"lineNumber":202378,"originalJapaneseLine":"「きゃあああ！？　な、なんで！？」","translatedEnglishLine":"\"Kyaa!? Why!?\""},{"lineNumber":202379,"originalJapaneseLine":"「きゃああああああああああああああ！？","translatedEnglishLine":"\"Kyaaaaaaaaaaaaaaa!?\""},{"lineNumber":202380,"originalJapaneseLine":"　お、落ちてるーー！？　いやーーー！？」","translatedEnglishLine":"We're fallingggg!? Nooo!?"},{"lineNumber":202381,"originalJapaneseLine":"「ぐわっははははは！","translatedEnglishLine":"\"Gwahahaha!"},{"lineNumber":202382,"originalJapaneseLine":"　大将！　オレ達落ちてるぞ！」","translatedEnglishLine":"Boss! We're falling!\""},{"lineNumber":202383,"originalJapaneseLine":"「わわわっ！？　どど、どーしよ！？」","translatedEnglishLine":"\"Wawawa!? Wha- what should we do!?\""},{"lineNumber":202384,"originalJapaneseLine":"「なっ、くっ！？」","translatedEnglishLine":"\"What, ugh!?\""},{"lineNumber":202385,"originalJapaneseLine":"全身を襲う身の毛もよだつような浮遊感。","translatedEnglishLine":"A hair-raising sensation of floating swept over your entire body."},{"lineNumber":202386,"originalJapaneseLine":"為す術なくあなたは風を切って、","translatedEnglishLine":"Helpless, you sliced through the air,"},{"lineNumber":202387,"originalJapaneseLine":"ただ気の遠くなるような時間落ち続ける。","translatedEnglishLine":"and just kept falling for what felt like an endless time."},{"lineNumber":202388,"originalJapaneseLine":"――地面が見えてきた。","translatedEnglishLine":"—The ground came into view."},{"lineNumber":202389,"originalJapaneseLine":"このままではただ墜落死するだけだが、","translatedEnglishLine":"If things continued like this, you would simply die from crashing,"},{"lineNumber":202390,"originalJapaneseLine":"あなたにはそれに抗うすべがない。","translatedEnglishLine":"but you had no way to resist it."},{"lineNumber":202391,"originalJapaneseLine":"無力なあなたはヘルマンの固い大陸に向かって","translatedEnglishLine":"Powerless, you fell straight toward the hard continent of Helman,"},{"lineNumber":202392,"originalJapaneseLine":"真っ直ぐに落ちて、地面に――","translatedEnglishLine":"falling straight down toward the ground—"},{"lineNumber":202393,"originalJapaneseLine":"　","translatedEnglishLine":""},{"lineNumber":202394,"originalJapaneseLine":"　　＜するっ！＞","translatedEnglishLine":"  <whoosh!>"},{"lineNumber":202395,"originalJapaneseLine":"――叩きつけられずに、地をすり抜けた。","translatedEnglishLine":"You slipped through the earth without being slammed into it."},{"lineNumber":202396,"originalJapaneseLine":"「…………。」","translatedEnglishLine":"\"........\""},{"lineNumber":202397,"originalJapaneseLine":"あなたは地面に触れることなく、","translatedEnglishLine":"Without touching the ground,"},{"lineNumber":202398,"originalJapaneseLine":"下へ下へと落ち続けていた。","translatedEnglishLine":"you continued to fall down, down."},{"lineNumber":202399,"originalJapaneseLine":"「ほげええええええええ！？！？！？","translatedEnglishLine":"\"Hogeeeeeeeee!?!?!"},{"lineNumber":202400,"originalJapaneseLine":"　なんですり抜けてんのぉおお！？","translatedEnglishLine":"Why am I slipping through!?\""},{"lineNumber":202401,"originalJapaneseLine":"　落ちる落ちる落ちるぅぅうううう！！！！」","translatedEnglishLine":"Falling, falling, fallinglllll!!!!\""},{"lineNumber":202402,"originalJapaneseLine":"「く、＜エール＞、様……」","translatedEnglishLine":"\"Ku, <Eru>, sir...\""},

{"lineNumber":202403,"originalJapaneseLine":"「……ぐう！」","translatedEnglishLine":"\"...Ugh!\""},

{"lineNumber":202404,"originalJapaneseLine":"「いやあああああ！？　＜エール＞ーーーー！？」","translatedEnglishLine":"\"Nooooooo!? <Eru>——!?\""},{"lineNumber":202405,"originalJapaneseLine":"「きゃあああ！？","translatedEnglishLine":"\"Kyaaa!?\""},{"lineNumber":202406,"originalJapaneseLine":"　もう、どうなってんのぉぉー！？」","translatedEnglishLine":"What's happening already!?"},{"lineNumber":202407,"originalJapaneseLine":"「あっ、くう！　＜エール＞ちゃん！」","translatedEnglishLine":"\"Ah, ugh! <Eru>-chan!\""},{"lineNumber":202408,"originalJapaneseLine":"「あの白陶器ぃい！","translatedEnglishLine":"\"That white porcelain!\""},{"lineNumber":202409,"originalJapaneseLine":"　いつか必ず死んでもブッ殺す！」","translatedEnglishLine":"Someday, even if you die, I will definitely kill you!\""},{"lineNumber":202410,"originalJapaneseLine":"「うにゃあああ！？","translatedEnglishLine":"\"Unyaaah!?\""},{"lineNumber":202411,"originalJapaneseLine":"　い、いつまで落ちるでござるぅー！」","translatedEnglishLine":"How much longer are we going to keep falling!?\""},{"lineNumber":202412,"originalJapaneseLine":"「くっ、地面をすり抜けるとは……！","translatedEnglishLine":"\"Damn, slipping through the ground...!\""},{"lineNumber":202413,"originalJapaneseLine":"　＜エール＞、どうにか僕に……！」","translatedEnglishLine":"<Eru>, somehow help me...!\""},{"lineNumber":202414,"originalJapaneseLine":"「…………」","translatedEnglishLine":"\"........\""},{"lineNumber":202415,"originalJapaneseLine":"「母上に、深根は幸せだったとお伝え下さい……」","translatedEnglishLine":"Please tell my mother that Fukane was happy...\""},{"lineNumber":202416,"originalJapaneseLine":"「くっ、あんで落ち続けてんのよ！？」","translatedEnglishLine":"\"Ugh, why am I still falling!?\""},{"lineNumber":202417,"originalJapaneseLine":"「あ、はは……す、すり抜けてる……","translatedEnglishLine":"\"Ah, haha... I'm slipping through... "},{"lineNumber":202418,"originalJapaneseLine":"　あわわわわ……」","translatedEnglishLine":"Awawawawa...\""},{"lineNumber":202419,"originalJapaneseLine":"「ぐわっはははははははは！","translatedEnglishLine":"\"Gwahahahahahahaha!"},{"lineNumber":202420,"originalJapaneseLine":"　これはいよいよもって珍妙な！」","translatedEnglishLine":"This is truly something bizarre!\""},{"lineNumber":202421,"originalJapaneseLine":"「アハハハハ！　地面すり抜けてる！","translatedEnglishLine":"\"Ahahahaha! Slipping right through the ground!\""}]}

